          name: "Thorstein",
          companyName: "Zoozzy",
          email: "togborne8@wsj.com",
          gender: "Male",
          city: "Xinchengpu",
          country: "China",
        },
        {
          _id: 10,
          name: "Skipp",
          companyName: "Gigabox",
          email: "sweymont9@nih.gov",
          gender: "Male",
          city: "Yao’an",
          country: "China",
        },
      ],
    },
  };

  handleRoute = (
    path = "/rules-extraction/ingestion/manual-upload-form/new"
  ) => {
    this.props.history.push(path);
  };

  render() {
    return (
      <React.Fragment>
        <InfoPanel
          title="Manual Upload Repository"
          subtitle="Here you can manage your manually uploaded documents."
          btnLabel="Add Document"
          onRoute={this.handleRoute}
        />
        <Table table={this.state.table} onRoute={this.handleRoute} />
      </React.Fragment>
    );
  }
}

export default ManualUploadRepo;
